description:
Saicum is a platform game and puzzle, using artistic elements of the 19th century to mount the challenge of the game, you start the game at a museum of old paintings of impressionist movement by artists Claude Monet, Renoir, Van Gogh and others.

At the beginning of the game the most important painting of the museum disappeared, this painting was divided into 32 pieces.

You need to find all 32 pieces that are scattered and hidden in the museum, some pieces are easy to find but others are extremely challenging to find.

